import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import logo from './logo.svg';

const Layout = () => {
  return (
    <div style={{ position: 'relative', minHeight: '100vh' }}>
      <Link to="/">
        <img src={logo} className="App-logo" alt="logo" />
      </Link>
      <main>
        <Outlet />
      </main>
    </div>
  );
};

export default Layout;
